// @note Actual code?!?!?!
function load() {
    // script for when page loads
    let button = document.getElementById("random")

    let modal = document.getElementById("modal");
    let modalImg = document.getElementById("modal-image");
    let captionText = document.getElementById("modal-caption");
    let modalLink = document.getElementById("modal-link");
    let modalClose = document.getElementsByClassName("close")[0];

    const horses = {
        categoryName: "horses",
        dataBank: horseList,
        image1: document.getElementById("horse-1-image"),
        title1: document.getElementById("horse-1-title"),
        link1: document.getElementById("horse-1-link"),
        image2: document.getElementById("horse-2-image"),
        title2: document.getElementById("horse-2-title"),
        link2: document.getElementById("horse-2-link")
    }
    const herds = {
        categoryName: "Herd: ",
        dataBank: herdList,
        caption: document.getElementById("herd-caption"),
        link: document.getElementById("herd-link"),
        image: document.getElementById("herd-icon")
    }
    const types = {
        categoryName: "Horse Type: ",
        dataBank: typeList,
        caption: document.getElementById("type-caption")
    }
    const themes = {
        categoryName: "Theme/Accessory: ",
        dataBank: themeList,
        caption: document.getElementById("theme-caption")
    }
    const coats = {
        categoryName: "Coat: ",
        dataBank: coatList,
        caption: document.getElementById("coat-caption"),
        image: document.getElementById("coat-icon")
    }
    const patterns = {
        categoryName: "Pattern: ",
        dataBank: patternList,
        caption: document.getElementById("pattern-caption")
    }
    const accents = {
        categoryName: "Accent Colour: ",
        dataBank: accentList,
        caption: document.getElementById("accent-caption")
    }

    // When the user clicks the button, randomise the images
    // TODO add a selection lock so only remaining images are randomised
    button.addEventListener('click', randomise)
    function randomise() {
        pickRandomHorses();
        pickRandomImage(herds);
        pickRandomImage(types);
        pickRandomImage(themes);
        pickRandomImage(coats);
        pickRandomImage(patterns);
        pickRandomImage(accents);
    }
    function pickRandomHorses() {
        let arr = [];
        while (arr.length < 2) {
            let r = Math.floor(Math.random() * horses.dataBank.length);
            if (arr.indexOf(r) === -1) arr.push(r);
        }

        updateHorseImage(arr[0], horses.image1, horses.title1, horses.link1);
        updateHorseImage(arr[1], horses.image2, horses.title2, horses.link2);
    }
    function updateHorseImage(number, image, title, link) {
        image.src = "./unknownHorse.png"
        image.src = horses.dataBank[number].src;
        image.alt = horses.dataBank[number].title;
        image.setAttribute("category", horses.categoryName)
        image.setAttribute("index", number)
        title.innerText = horses.dataBank[number].title;
        link.href = horses.dataBank[number].info;
    }
    function pickRandomImage(category) {
        let n = Math.floor(Math.random() * category.dataBank.length);
        if ('image' in category) {
            category.image.src = "unknown.png"
            category.image.src = category.dataBank[n].src
        }
        if ('caption' in category) {
            category.caption.innerText = category.categoryName + category.dataBank[n].caption
        }
        if ('link' in category) {
            category.caption.innerHTML = category.categoryName + `<a id="herd-link" target="_blank" href="${category.dataBank[n].link}">${category.dataBank[n].caption}</a>`
        }
    }
}
